namespace Tests\Traits;

use tcCore\Test;
use tcCore\TestQuestion;
use tcCore\Question;

trait DrawingQuestionTrait
{
    
    private function createDrawingQuestion($attributes){
        $response = $this->post(
            'api-c/test_question',
            static::getTeacherOneAuthRequestData(
                $attributes
            )
        );
        $response->assertStatus(200);
        $testQuestionId = $response->decodeResponseJson()['id'];
        $this->originalQuestionId = $testQuestionId;
        return $testQuestionId;
    }

    private function editDrawingQuestion($uuid,$attributes){
        $testCountInit = Test::count();
        $testQuestionCountInit = TestQuestion::count();
        $questionCountInit = Question::count();
        $response = $this->put(
            'api-c/test_question/'.$uuid,
            static::getTeacherOneAuthRequestData(
                $attributes
            )
        );
        // $this->assertEquals($testCountInit, Test::count());
        // $this->assertEquals($testQuestionCountInit, TestQuestion::count());
        // $this->assertEquals(++$questionCountInit, Question::count());
        $response->assertStatus(200);
    }

    private function getAttributesForDrawingQuestion($testId){
        return [    
                    "type"=> "DrawingQuestion",
                    "score"=> "5",
                    "question"=> "<p>Drawing question</p> ",
                    "order"=> 0,
                    "maintain_position"=> "0",
                    "discuss"=> "1",
                    "decimal_score"=> "0",
                    "add_to_database"=> 1,
                    "attainments"=> [
                    ],
                    "note_type"=> "NONE",
                    "is_open_source_content"=> 0,
                    "answer"=> $this->getDrawing(),
                    "tags"=> [
                    ],
                    "rtti"=> null,
                    "bloom"=> null,
                    "miller"=> null,
                    "test_id"=> $testId,
                    "closeable"=> 0,
                ];
    }

    private function getDrawing(){
        return 'data:image/png;base64,';
    }

}